"""# Single Source Reachability O(|E|)"""

from collections import deque

def dfs(graph, start, visited=None):
    if visited is None:
        visited = set()
    visited.add(start)
    for neighbor in graph[start]:
        if neighbor not in visited:
            dfs(graph, neighbor, visited)
    return visited

def bfs(graph, start):
    visited = set()
    queue = deque([start])
    visited.add(start)
    while queue:
        node = queue.popleft()
        for neighbor in graph[node]:
            if neighbor not in visited:
                visited.add(neighbor)
                queue.append(neighbor)
    return visited

def single_source_reachability(graph, source, method='dfs'):
    if method == 'dfs':
        return dfs(graph, source)
    elif method == 'bfs':
        return bfs(graph, source)
    else:
        raise ValueError("Invalid method. Choose 'dfs' or 'bfs'.")

