"""With Dijkstra"""

import heapq

def dijkstra(graph, start):
    shortest_paths = {start: (None, 0)}
    queue = [(0, start)]

    while queue:
        current_distance, current_vertex = heapq.heappop(queue)

        for neighbor, weight in graph[current_vertex].items():
            distance = current_distance + weight
            if neighbor not in shortest_paths or distance < shortest_paths[neighbor][1]:
                shortest_paths[neighbor] = (current_vertex, distance)
                heapq.heappush(queue, (distance, neighbor))

    return shortest_paths

def build_shortest_path_tree(graph, start):
    shortest_paths = dijkstra(graph, start)
    shortest_path_tree = {}

    for vertex in shortest_paths:
        parent, distance = shortest_paths[vertex]
        if parent is not None:
            if parent not in shortest_path_tree:
                shortest_path_tree[parent] = []
            shortest_path_tree[parent].append(vertex)

    return shortest_path_tree

